/* Our picky compiler wants prototypes! */
void Multiply(matrix A, matrix B, matrix Res);
void Test(matrix A, matrix B, matrix Res);
void Initialize(matrix Array, OP_PRECISION table[UPPERLIMIT][UPPERLIMIT]);
OP_PRECISION RandomInteger(void);


void main()
{
FIM_Instantiate();
/* ***UPPSALA WCET***:
   no printing please! */
   Test(ArrayA, ArrayB, ResultArray);

FIM_exit();
}

void Test(matrix A, matrix B, matrix Res)
/*
 * Runs a multiplication test on an array.  Calculates and prints the
 * time it takes to multiply the matrices.
 */
{

   Initialize(A,tableA);
   Initialize(B,tableB);

   Multiply(A, B, Res);
}


void Initialize(matrix Array, OP_PRECISION table[UPPERLIMIT][UPPERLIMIT])
/*
 * Intializes the given array with random integers.
 */
{
   int OuterIndex, InnerIndex;

   for (OuterIndex = 0; OuterIndex < UPPERLIMIT; OuterIndex++)
      for (InnerIndex = 0; InnerIndex < UPPERLIMIT; InnerIndex++)
         Array[OuterIndex][InnerIndex] = table[OuterIndex][InnerIndex];
}

void Multiply(matrix A, matrix B, matrix Res)
/*
 * Multiplies arrays A and B and stores the result in ResultArray.
 */
{
   register int Outer, Inner, Index;

   for (Outer = 0; Outer < UPPERLIMIT; Outer++)
      for (Inner = 0; Inner < UPPERLIMIT; Inner++)
      {
         Res [Outer][Inner] = 0;
         for (Index = 0; Index < UPPERLIMIT; Index++)
            Res[Outer][Inner]  +=
               A[Outer][Index] * B[Index][Inner];
       }
}
